import React from 'react';

const Header = () => {
    return (
        <header>
            <nav>
                <div><a href='#'>Hotel Name</a></div>
                
                <a href='#'>Rooms</a>
                <a href='#'>Restaurant</a>
                <a href='#'>About</a>
                <a href='#'>Blog</a>
                <a href='#'>Contact</a>
            </nav>
        </header>
    )
}

export default Header;
